import React from "react";

export default class Grid extends React.component {

  createTable = () => {
    let table = []

    //outer loop
    for (let i=0; i < 3; i++) {
      let children = []
      //inner loop
      for (let j=0; j < 4; j++) {
        children.push(<td>{'Column ${j + 1}'}</td>)
      }
      table.push(<tr>{children}</tr>)
    }
    return table
  }
  
}
